import React from 'react'
import './Header.css';

function Header() {
  return (
    <nav className= 'header'>
       <a href="/" className='link'>
        <h1 className='header-h-one'>National Association of Plant Breeders' 2024 Annual Meeting</h1>
       </a>
    </nav>
  );
}

export default Header
